import React from "react";

import "./style.scss";

function CollapseItem(props) {
  return (
    <div className="collapseitem">
      <div className="collapseitem-button">What is Fashone.</div>
      <div className="collapseitem-content">{props.children}</div>
    </div>
  );
}

export default CollapseItem;
